INSERT INTO "series" ("_Serie__tmdb_id_serie", "_Serie__name", "_Serie__overview", "_Serie__backdrop_path", "_Serie__poster_path", "_Serie__nb_seasons", "_Serie__nb_episodes", "_Serie__next_episode_name", "_Serie__next_episode_air_date", "_Serie__next_episode_season_number", "_Serie__next_episode_episode_number", "_Serie__vote_count", "_Serie__vote_average", "_Serie__creation", "_Serie__last_update") VALUES
(1399,	'Game of Thrones',	'Seven noble families fight for control of the mythical land of Westeros. Friction between the houses leads to full-scale war. All while a very ancient evil awakens in the farthest north. Amidst the war, a neglected military order of misfits, the Night''s Watch, is all that stands between the realms of men and icy horrors beyond.',	'/suopoADq0k8YZr4dQXcU6pToj6s.jpg',	'/u3bZgnGQ9T01sWNhyveQz0wH0Hl.jpg',	8,	73,	NULL,	NULL,	NULL,	NULL,	6498,	8.1,	1574714011,	1574714011),
(1418,	'The Big Bang Theory',	'The Big Bang Theory is centered on five characters living in Pasadena, California: roommates Leonard Hofstadter and Sheldon Cooper; Penny, a waitress and aspiring actress who lives across the hall; and Leonard and Sheldon''s equally geeky and socially awkward friends and co-workers, mechanical engineer Howard Wolowitz and astrophysicist Raj Koothrappali. The geekiness and intellect of the four guys is contrasted for comic effect with Penny''s social skills and common sense.',	'/nGsNruW3W27V6r4gkyc3iiEGsKR.jpg',	'/ooBGRQBdbGzBxAVfExiO8r7kloA.jpg',	12,	279,	NULL,	NULL,	NULL,	NULL,	3882,	6.8,	1574714030,	1574714030),
(82856,	'The Mandalorian',	'Set after the fall of the Empire and before the emergence of the First Order, we follow the travails of a lone gunfighter in the outer reaches of the galaxy far from the authority of the New Republic.',	'/o7qi2v4uWQ8bZ1tW3KI0Ztn2epk.jpg',	'/BbNvKCuEF4SRzFXR16aK6ISFtR.jpg',	1,	8,	'Chapter 4',	'2019-11-29',	1,	4,	115,	7.6,	1574714053,	1574714053),
(60625,	'Rick and Morty',	'Rick is a mentally-unbalanced but scientifically-gifted old man who has recently reconnected with his family. He spends most of his time involving his young grandson Morty in dangerous, outlandish adventures throughout space and alternate universes. Compounded with Morty''s already unstable family life, these events cause Morty much distress at home and school.',	'/mzzHr6g1yvZ05Mc7hNj3tUdy2bM.jpg',	'/qJdfO3ahgAMf2rcmhoqngjBBZW1.jpg',	4,	36,	'Claw and Hoarder: Special Ricktim''s Morty',	'2019-12-01',	4,	4,	1515,	8.6,	1574714079,	1574714079),
(68507,	'His Dark Materials',	'Lyra is an orphan who lives in a parallel universe in which science, theology and magic are entwined. Lyra''s search for a kidnapped friend uncovers a sinister plot involving stolen children, and turns into a quest to understand a mysterious phenomenon called Dust. She is later joined on her journey by Will, a boy who possesses a knife that can cut windows between worlds. As Lyra learns the truth about her parents and her prophesied destiny, the two young people are caught up in a war against celestial powers that ranges across many worlds.',	'/9yKCJTOh9m3Lol2RY3kw99QPH6x.jpg',	'/xOjRNnQw5hqR1EULJ2iHkGwJVA4.jpg',	1,	8,	'The Lost Boy',	'2019-12-01',	1,	5,	66,	7.8,	1574714101,	1574714101);

