INSERT INTO "seasons" ("_Season__tmdb_id_season", "_Season__name", "_Season__overview", "_Season__season_number", "_Season__air_date", "_Season__poster_path", "_Season__tmdb_id_serie") VALUES
(3627,	'Specials',	'',	0,	'2010-12-05',	'/kMTcwNRfFKCZ0O2OaBZS0nZ2AIe.jpg',	1399),
(3624,	'Season 1',	'Trouble is brewing in the Seven Kingdoms of Westeros. For the driven inhabitants of this visionary world, control of Westeros'' Iron Throne holds the lure of great power. But in a land where the seasons can last a lifetime, winter is coming...and beyond the Great Wall that protects them, an ancient evil has returned. In Season One, the story centers on three primary areas: the Stark and the Lannister families, whose designs on controlling the throne threaten a tenuous peace; the dragon princess Daenerys, heir to the former dynasty, who waits just over the Narrow Sea with her malevolent brother Viserys; and the Great Wall--a massive barrier of ice where a forgotten danger is stirring.',	1,	'2011-04-17',	'/zwaj4egrhnXOBIit1tyb4Sbt3KP.jpg',	1399),
(3625,	'Season 2',	'The cold winds of winter are rising in Westeros...war is coming...and five kings continue their savage quest for control of the all-powerful Iron Throne. With winter fast approaching, the coveted Iron Throne is occupied by the cruel Joffrey, counseled by his conniving mother Cersei and uncle Tyrion. But the Lannister hold on the Throne is under assault on many fronts. Meanwhile, a new leader is rising among the wildings outside the Great Wall, adding new perils for Jon Snow and the order of the Night''s Watch.',	2,	'2012-04-01',	'/5tuhCkqPOT20XPwwi9NhFnC1g9R.jpg',	1399),
(3626,	'Season 3',	'Duplicity and treachery...nobility and honor...conquest and triumph...and, of course, dragons. In Season 3, family and loyalty are the overarching themes as many critical storylines from the first two seasons come to a brutal head. Meanwhile, the Lannisters maintain their hold on King''s Landing, though stirrings in the North threaten to alter the balance of power; Robb Stark, King of the North, faces a major calamity as he tries to build on his victories; a massive army of wildlings led by Mance Rayder march for the Wall; and Daenerys Targaryen--reunited with her dragons--attempts to raise an army in her quest for the Iron Throne.',	3,	'2013-03-31',	'/7d3vRgbmnrRQ39Qmzd66bQyY7Is.jpg',	1399),
(3628,	'Season 4',	'The War of the Five Kings is drawing to a close, but new intrigues and plots are in motion, and the surviving factions must contend with enemies not only outside their ranks, but within.',	4,	'2014-04-06',	'/dniQ7zw3mbLJkd1U0gdFEh4b24O.jpg',	1399),
(62090,	'Season 5',	'The War of the Five Kings, once thought to be drawing to a close, is instead entering a new and more chaotic phase. Westeros is on the brink of collapse, and many are seizing what they can while the realm implodes, like a corpse making a feast for crows.',	5,	'2015-04-12',	'/527sR9hNDcgVDKNUE3QYra95vP5.jpg',	1399),
(71881,	'Season 6',	'Following the shocking developments at the conclusion of season five, survivors from all parts of Westeros and Essos regroup to press forward, inexorably, towards their uncertain individual fates. Familiar faces will forge new alliances to bolster their strategic chances at survival, while new characters will emerge to challenge the balance of power in the east, west, north and south.',	6,	'2016-04-24',	'/zvYrzLMfPIenxoq2jFY4eExbRv8.jpg',	1399),
(81266,	'Season 7',	'The long winter is here. And with it comes a convergence of armies and attitudes that have been brewing for years.',	7,	'2017-07-16',	'/3dqzU3F3dZpAripEx9kRnijXbOj.jpg',	1399),
(107971,	'Season 8',	'The Great War has come, the Wall has fallen and the Night King''s army of the dead marches towards Westeros. The end is here, but who will take the Iron Throne?',	8,	'2019-04-14',	'/39FHkTLnNMjMVXdIDwZN8SxYqD6.jpg',	1399),
(3732,	'Specials',	NULL,	0,	'',	'/gtWHKUsG8de6LdZQoCsjUqrLJ1R.jpg',	1418),
(3738,	'Season 1',	'University physicists Leonard and Sheldon know whether to use an integral or a differential to solve the area under a curve. But they don''t have a clue about girls. Or dating. Or clothes. Or parties. Or having fun. Or, basically, life. So when a pretty blonde named Penny moves in the apartment across the hall, the guys decide to get an education outside of the classroom. Boys, you have a lot to learn.',	1,	'2007-09-24',	'/zqAL2rav7Tg8uwDtLurqZVN3mtr.jpg',	1418),
(3733,	'Season 2',	'This season, Leonard gets a girl. So does Sheldon. Howard drives the Mars Rover into a ditch. Raj woos a terminator. Gorgeous girl-next-door Penny falls under the spell of Age of Conan. And super-smart, ueberconfident Leslie Winkler reduces mere men to spineless jellyfish.',	2,	'2008-09-22',	'/2NBwUBZ4clwj6qO9fBinfxiB0dR.jpg',	1418),
(3734,	'Season 3',	'Worlds collide in Season 3! A love affair with Penny has opened a big, wide, wonderful world of romance for Leonard. But Sheldon likes the world just the way it was, thank you. All of which makes for a zany comic triangle with brainy, clueless Sheldon and practical, grounded Penny hilariously vying for the role of hypotenuse.',	3,	'2009-09-21',	'/j64iUb52W2IYE9qV9pLi5tFq8IE.jpg',	1418),
(3735,	'Season 4',	'This season the Big Bang gang’s romantic universe expands. On the rebound from Penny, Leonard falls into the arms of Raj’s sister Priya. Sheldon gets a girlfriend, or rather a friend who is a girl: Amy, a dour neurobiologist who declares herself besties with Penny. Howard and Bernadette heat up. And so do Raj and Bernadette (at least in Raj’s Bollywood daydream).',	4,	'2010-09-23',	'/hM2TYCmOVXop1xhLA1Mbqyg60ze.jpg',	1418),
(3736,	'Season 5',	'In season five, Penny and Leonard''s relationship is relaunched in full "beta test" mode, while Sheldon, Howard, and Raj discover the feminine mystique is something that cannot be easily graphed or calculated. As Sheldon makes begrudging amendments to his "Relationship Agreement" with his "friend-who-happens-to-be-a-girl" Amy Farrah Fowler, Raj contemplates an arranged marriage, and Howard is all-systems-go for both is NASA space launch and wedding to the spirited Bernadette.',	5,	'2011-09-22',	'/l08Z8ihAsTRPEuOehbwk4axg3cu.jpg',	1418),
(3737,	'Season 6',	'Whether on or above Earth, hilarity is outrageously universal in TV''s most popular comedy featuring four forward-thinking but socially backward geniuses. Fun discoveries multiply: Leonard learns jealousy is bad for a relationship (with Penny) but science is good for seduction (of Penny). Howard finds life in the International Space Station life is no escape from terrestrial turmoil between his mom and his new wife Bernadette. Raj meets someone special who may be a good match, if he can keep her from fleeing mid-date. And then there''s Sheldon. He learns what not to say after facing harassment charges or competing for tenure at work and how Dungeons & Dragons can be the icebreaker his relationship with Amy needs.',	6,	'2012-09-27',	'/2Rsb94mlt4OHhiO2UWatDOhnBqv.jpg',	1418),
(3739,	'Season 7',	'Leonard returns from his North Sea expedition to find that his relationship with Penny involves more beta-testing than he’s ever done in a lab. Howard’s attachment issues with the women in his life in particular and Raj’s social breakthrough with women in general provide more laughs. Bernadette and Amy stand staunchly by the men in their life, even when they’re sitting in marathon role-playing games. Sheldon sees his mom in a totally different way, parties with James Earl Jones, establishes a (sort of) bond with his idol Professor Proton and makes a scientific breakthrough that breaks down before you can say Science Friday.',	7,	'2013-09-26',	'/BkPuEw0SnnEbSN3rBVwNqf8rIB.jpg',	1418),
(66738,	'Season 2',	'After Rick and Morty decided to unfreeze time, they must deal with alien parasites, alternate Jerrys and a decaying, possibly non-existent dimension.',	2,	'2015-07-26',	'/zkhGdE29umuKwa6u6mm7e4cXvYY.jpg',	60625),
(62016,	'Season 8',	'Sheldon is rescued from his soul-searching cross-country train trip (older but no wiser) and that means The Big Bang Theory gang''s all here to spread another gear''s cheer as TV''s most attended laugh seminar. Enrol in the comic curriculum to observe Leonard''s minor surgery, which signals a major catastrophe for Sheldon, Howard''s obsession over his mum''s relationship with friend-turned-freeloader Stuart and the unexpected results of Penny''s technique as a pharmaceutical sales rep. Discover ways to re-create proms not attended or holiday celebrations not especially beloved and play a new game based on Raj''s dating life. Savour online fan Fiction by Amy, watch Bernadette take indelicate command of some delicate family matters and, who knows, you might spot a cool special guest or two.',	8,	'2014-09-22',	'/xRmI9NMK6OJYOwT3U7VLSXJ4hny.jpg',	1418),
(110346,	'Season 1',	'',	1,	'2019-11-12',	'/sUTqIb82LxYhPT0SfI8AR03GLpz.jpg',	82856),
(91000,	'Season 11',	'After years of only looking out for himself, Sheldon found Amy Farrah Fowler to be the most patient woman to ever walk the earth, and... they did it! Wedding fever continues in season 11.',	11,	'2017-09-25',	'/8MEDs1tCk6qWg2TlJJHZIPq4aWY.jpg',	1418),
(81616,	'Season 1',	'',	1,	'2019-11-03',	'/xOjRNnQw5hqR1EULJ2iHkGwJVA4.jpg',	68507),
(70493,	'Season 9',	'Our two genius roommates, Leonard and Sheldon, and their friends are back once again (smarter, but no wiser). Last season, Sheldon went soul-searching (on a train, of course) and was prepared to make some substantial revisions on his Relationship Agreement with Amy, when everything changed. Leonard, meanwhile, was off to Vegas with Penny to finally tie the knot in the season finale. Howard finds himself alone with Bernadette after the sudden passing of his mother; while Raj is not only talking to women – he’s getting exclusive with Emily. Together, they will all learn that life is far more complicated outside of the lab as love and friendship never produce predictable results!',	9,	'2015-09-21',	'/mhbRUIpZ0ex3I4vUtvBl0guKHar.jpg',	1418),
(80035,	'Season 10',	'Leonard and Penny renew their vows, this time inviting their friends and family for wedding party; they also learn that marriage is about compromise, and figure out how to support each other. Sheldon and Amy experiment to take their relationship to the next level, and after an emotional struggle they move in together in Penny''s old apartment. Howard and Bernadette realise that being a parent is a full-time job, but with the help of their friends they manage to find joy in raising their child. When his friends tell him he''s extremely spoiled, Raj decides to stop taking his father''s money and learn how to make ends meet.',	10,	'2016-09-19',	'/dz2Mq1bpjBFiTOJbomCEP59kqJV.jpg',	1418),
(107083,	'Season 12',	'',	12,	'2018-09-24',	'/wsbrXP0qAKwrJ3ZUCoLwFI4Qws3.jpg',	1418),
(106178,	'Specials',	'',	0,	'2016-10-26',	'/qJdfO3ahgAMf2rcmhoqngjBBZW1.jpg',	60625),
(60059,	'Season 1',	'Rick and Morty visit a pawn shop in space, encounter various alternate and virtual realities, and meet the devil at his antique shop.',	1,	'2013-12-02',	'/pZoqbuJGaVM7vgzsSCPwRH5TCx5.jpg',	60625),
(86926,	'Season 3',	'Rick and Morty travel to Atlantis and take some time to relax, plus Rick turns himself into a pickle and faces off against the president.',	3,	'2017-04-01',	'/qJ7ILAEJFbBP3DzsTU2Va551iiP.jpg',	60625),
(128112,	'Season 4',	'',	4,	'2019-11-10',	'/ylL3eViYKBhtjaqVe4pLMslVBjR.jpg',	60625);

