INSERT INTO "episodes" ("_Episode__tmdb_id_episode", "_Episode__name", "_Episode__overview", "_Episode__season_number", "_Episode__episode_number", "_Episode__vote_count", "_Episode__vote_average", "_Episode__air_date", "_Episode__still_path", "_Episode__tmdb_id_season") VALUES
(63087,	'Inside Game of Thrones',	'A short look into the film-making process for the production Game of Thrones',	0,	1,	8,	5.2,	'2010-12-05',	'/1aVzF5os3TEMeQBTyNWPlKVsY0f.jpg',	3627),
(63086,	'15-Minute Preview',	'An approximately 15-minute preview of the first episode of Game of Thrones.',	0,	2,	3,	8.2,	'2011-04-03',	'/7LUPfB5mrNfplDFfpZIjFL5J9fI.jpg',	3627),
(63088,	'Making Game of Thrones',	'An exclusive 30-minute feature including never-before-seen footage from the set and interviews from the cast and crew',	0,	3,	3,	8.3,	'2011-04-07',	'/wK6sLD7YIgnteEjxdWzT9xe4WvW.jpg',	3627),
(63089,	'El Juego Comienza',	'A spanish "Canal +`" production with interviews to some famous spanish movie directors like Alex de La Iglesia and extracts from last special "Making Game Of Thrones"',	0,	4,	2,	7.0,	'2011-04-10',	'/kMTcwNRfFKCZ0O2OaBZS0nZ2AIe.jpg',	3627),
(63090,	'2011 Comic Con Panel',	'',	0,	5,	2,	7.8,	'2011-07-21',	'/xydHpOh6zViapTSedZEKdqhruNX.jpg',	3627),
(63091,	'You Win or You Die',	'A prequel to Game of Thrones Season 2 which recaps on the first season and gives insight into what''s to come.',	0,	6,	4,	5.0,	'2012-03-24',	'/6M8HOqp1AnaabsMnBDczrxMPPVS.jpg',	3627),
(63092,	'A Gathering Storm',	'A prequel to Game of Thrones Season 3 which recaps on the first and second season and gives insight into what''s to come.',	0,	7,	2,	9.5,	'2013-03-08',	'/b0FeVwxVweWQ5RQtQztBhE6vEhC.jpg',	3627),
(63093,	'Politics of Marriage',	'Love and marriage? They don''t go together so well in ''Game of Thrones'' where the concept of matrimony is all about making power plays and political alliances. Cast and crew members along with author George R.R. Martin take a fascinating look at this ancient institution and its place in the hit HBO series.',	0,	8,	1,	10.0,	'2013-05-19',	'/uWDFqmA43kepOPEzgJf6s30ZHR6.jpg',	3627),
(974558,	'Ice and Fire: A Foreshadowing',	'Take a look back and a look forward to the fourth season of the hit HBO series, the show features clips from upcoming episodes, behind the scenes footage, interviews with talent, and cast members'' answers to questions posed by fans.',	0,	9,	2,	9.8,	'2014-02-09',	'/1pjvWsuiytWF4ks2PmHaaT7pSgy.jpg',	3627),
(974559,	'The Politics of Power: A Look Back at Season 3',	'Relive every thrilling, dramatic and tragic highlight from Season 3 of "Game of Thrones" in this comprehensive featurette. From Daenerys building a slave army to the infamous Red Wedding, not a detail is missed as recalled by the stars of the hit HBO series.',	0,	10,	3,	6.8,	'2014-03-12',	'/z5M4Fyyy0ioobo1MJ345gAWMrop.jpg',	3627),
(1041057,	'A Day in the Life',	'The 30-minute special documents one epic day of production as tackled by hundreds of crew members across three countries. In addition to a behind-the-scenes look at the action in Dubrovnik, Croatia, Belfast, Northern Ireland and Seville, Spain, the preview includes several never-before-seen features.',	0,	11,	2,	7.3,	'2015-02-08',	'/xUVCZNoGKrp4IbbExcMWUUOwDvT.jpg',	3627),
(1188785,	'The Story So Far (2016)',	'Ahead of Season 6 of the epic saga, this special will bring viewers up to speed on the gripping storylines and compelling characters from the first five seasons. Writers and stars of the show give viewers an insight into key events of each season and explain the intrigues and power struggles at work in the lands of Westeros and beyond.',	0,	12,	1,	10.0,	'2016-04-20',	'/gDJoLFcizTNzwanGxAmzjShNIfB.jpg',	3627),
(1203674,	'18 Hours at the Paint Hall',	'Take an inside look at an action-packed day inside the main production complex for ‘Game of Thrones’ in Belfast, Northern Ireland.',	0,	13,	0,	0.0,	'2016-07-03',	'/dDufP1c0an3m3qsO2AtqbG44hlH.jpg',	3627),
(1347221,	'The Story So Far (2017)',	'Ahead of the season seven premiere, get up to speed on all the action in Game of Thrones with this re-cap of the story so far.',	0,	14,	0,	0.0,	'2017-07-13',	'/kOk3k9QGezLWMGFGAovukX3R67m.jpg',	3627),
(1631882,	'The Story So Far (2015)',	'Ahead of the eagerly-anticipated fifth season, we bring you up tp speed with the events of the epic fantasy drama to date.  And to help the uninitiated ease into the wild world of Westeros, here''s a beginner''s guide to the fantasy epic.',	0,	15,	0,	0.0,	'2015-03-16',	'/kMTcwNRfFKCZ0O2OaBZS0nZ2AIe.jpg',	3627),
(1759666,	'The Story So Far (2018)',	'Ahead of the eagerly-anticipated season, we bring you up tp speed with the events of the epic fantasy drama to date. And to help the uninitiated ease into the wild world of Westeros, here’s a beginner’s guide to the fantasy epic.',	0,	16,	0,	0.0,	'2019-04-14',	'/lVFVxh3iayEd7mAtLwo94j34zeC.jpg',	3627),
(1799533,	'The Last Watch',	'A documentary chronicling the fantasy drama’s eighth and final season. British documentarian Jeanie Finlay was embedded on the series’ set during production of the final six episodes, and the footage she captured during that time delves deep into the mud and blood to reveal the tears and triumphs involved in the challenge of bringing the fantasy world of Westeros to life in the very real studios, fields and car-parks of Northern Ireland.',	0,	41,	0,	0.0,	'2019-05-26',	'/w5UoNNq2IY5BDgm9CWgPIZRnGnt.jpg',	3627),
